import React from "react";
import Header from "./components/Header";
import {HashRouter as Router,Routes,Route} from 'react-router-dom'
import HomeScreen from "./components/screens/HomeScreen";
import SignupScreen from "./components/screens/SignupScreen";
import LoginScreen from "./components/screens/LoginScreen";
import Logout from "./components/screens/Logout";
//import ProductScreen from "./components/screens/ProductScreen";
import MyList from "./components/Mylist";
import MyRateings from "./components/Myratings"
import Myrecommendation from "./components/recommendation"

import Api_data1 from "./components/fetchapitmbd"





export default function App() {
  return (

    <>
    <Router>
      <Header />

      <Routes>
        <Route exact path="/" element={<HomeScreen/>}></Route>
      </Routes>

      <Routes>
        <Route exact path="/login" element={<LoginScreen/>}></Route>
      </Routes>

      <Routes>
        <Route exact path="/signup" element={<SignupScreen/>}></Route>
      </Routes>

      <Routes>
        <Route exact path="/logout" element={<Logout/>}></Route>
      </Routes>

      <Routes>
        <Route exact path="/movies/:id/" element={<Api_data1/>}></Route>
      </Routes>

      <Routes>
        <Route exact path="/MyRatings" element={<MyRateings/>}></Route>
      </Routes>

      <Routes>
        <Route exact path="/mylist" element={<MyList/>}></Route>
      </Routes>

      <Routes>
        <Route exact path="/GetRecommendation" element={<Myrecommendation/>}></Route>
      </Routes>

    </Router>
    </>

  );
}
